import React from 'react';
import './App.css';

function Header() {
  return (
    <div style={{marginTop:'10px'}}>
      <div></div>
       <span className='glyphicon glyphicon-star' aria-hidden="true">star</span>
      <div style={{paddingLeft:'80%'}}> Task Manager </div>
      <hr/> 
    </div>
  );
}

export default Header;
